Get-Process | Select MainWindowTitle,ProcessName | where{$_.MainWindowTitle -ne ""} | Select MainWindowTitle > mytest.txt
Get-Process | Select MainWindowTitle,ProcessName | where{$_.MainWindowTitle -ne ""} | Select ProcessName >> mytest.txt
$vContent = Get-Content mytest.txt -Raw

$iconBase64                                = ''
$iconBytes = [Convert]::FromBase64String($iconBase64)
$stream = [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing
$Form = New-Object system.Windows.Forms.Form
[System.Windows.Forms.Application]::EnableVisualStyles()

$Form = New-Object system.Windows.Forms.Form
$Form.Icon = [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))
$Form.StartPosition = "CenterScreen"
$Form.BackColor = "White"
$Form.Text = "Active Window Titles & Process Names"
$Form.FormBorderStyle = 'Fixed3D'
$Form.MaximizeBox = $false
#$Form.Width = 500
#$Form.Height = 600
$Form.AutoSize = $True;
$Form.AutoScroll = $True
#$Form.AutoSizeMode = GrowAndShrink
$Font = New-Object System.Drawing.Font("Times New
Roman",10,[System.Drawing.FontStyle]::Regular)
# Font styles are: Regular, Bold, Italic, Underline, Strikeout
$Form.Font = $Font

$Label = New-Object System.Windows.Forms.Label
$Label.Text = $vContent
$Label.AutoSize = $True
$Label.Padding = 32
$Label.Visible = $false

$TextBox1 = New-Object System.Windows.Forms.TextBox
$TextBox1.ReadOnly = $true;
$TextBox1.Text = $vContent
$TextBox1.Width = 500
$TextBox1.Height = 600
$TextBox1.BorderStyle = 0;
$TextBox1.BackColor = "white"
$TextBox1.TabStop = $false;
$TextBox1.Multiline = $true;
#$TextBox1.AutoSize = $True
$TextBox1.Left = $TextBox1.Left + 24
$TextBox1.Padding = 32
$TextBox1.ScrollBars = "Vertical"
$TextBox1.WordWrap = $true

#$Form.Controls.Add($Label);
$Form.Controls.Add($TextBox1);

$Form.ShowDialog()
